<template>
  <div class="moving-cyclist">
    <div :style="bike">
      <svg class="moving-cyclist__cyclist" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" x="0px" y="0px" viewBox="0 0 264 241.2" xml:space="preserve">
        <g>
          <g
            style="transform-origin: 53px 188px"
            :style="wheel"
          >
            <image width="446" height="446" xlink:href="data:image/png;base64,"
                   transform="matrix(0.24 0 0 0.24 -2.540000e-02 134.297)" style="overflow: visible;"
            />
          </g>
          <g
            style="transform-origin: 211px 188px"
            :style="wheel"
          >
            <image width="446" height="446" xlink:href="data:image/png;base64,"
                   transform="matrix(0.24 0 0 0.24 156.9346 134.297)" style="overflow: visible;"
            />
          </g>
          <image width="754" height="854" xlink:href="data:image/png;base64,"
                 transform="matrix(0.24 0 0 0.24 48.4546 -0.103)" style="overflow: visible;"
          />
        </g>
      </svg>
    </div>
  </div>
</template>

<script>
export default {
  name: "MovingCyclist",
  props: {
    progress: {
      type: Number,
      default: 0
    }
  },

  computed: {
    bike() {
      return {
        transform: `translateX(${120 * this.progress}vw)`
      }
    },
    wheel() {
      return {
        transform: `rotateZ(${720 * this.progress}deg)`
      }
    }
  }
}
</script>

<style scoped>
.moving-cyclist {
  width: 140%;
  margin-left: -20%;
  margin-right: -20%;
}
.moving-cyclist__cyclist {
  width: 20vw;
}
</style>